\n\n\n2\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cchoice based on getting a good financial return on their expensive degree.\n\nDoes HBS have a tuition forgiveness depending on the type of work u do after graduation?\n\nJanuary 14, 2015\n\u001c34\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI concluded, if you want to help other people, be a manager . If done well, management is among the most noble of professions. You are in a position where you have eight or ten hours every day from every person who works for you. You have the opportunity to frame each person’s work so that, at the end of every day, your employees will go home feeling like Diana felt on her good day: living a life filled with motivators. I realized that if the theory of motivation applies to me, then I need to be sure that those who work for me have the motivators, too. The second realization I had is that the pursuit of money can, at best, mitigate the frustrations in your career—yet the siren song of riches has confused and confounded some of the best in our society. In order to really find happiness, you need to continue looking for opportunities that you believe are meaningful, in which you will be able to learn new things, to succeed,\n\nJanuary 14, 2015\n\u001c36\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cgiven more and more responsibility to shoulder. There’s an old saying: find a job that you love and you’ll never work a day in your life. People who truly love what they do and who think their work is meaningful have a distinct advantage when they arrive at work every day. They throw their best effort into their jobs, and it makes them very good at what they do.\n\nJanuary 14, 2015\n\u001c37\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe should always remember that beyond a certain point, hygiene factors such as money, status, compensation, and job security are much more a by-product of being happy with a job rather than the cause of it. Realizing this frees us to focus on the things that really matter.\n\nJanuary 14, 2015\n\u001c37\n\u0011\n\u0011\n\n\n3\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou have to balance the pursuit of aspirations and goals with taking advantage of unanticipated opportunities. Managing this part of the strategy process is often the difference between success and failure for companies; it’s true for our careers, too.\n\nJanuary 14, 2015\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAs Professor Henry Mintzberg taught, options for your strategy spring from two very different sources. The first source is anticipated opportunities—the opportunities that you can see and choose to pursue. In Honda’s case, it was the big-bike market in the United States. When you put in place a plan\n\nJune 13, 2017\n\u001c42\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cassociated with fixing them, and the opportunity to sell the little Super Cub motorbikes.\n\nJanuary 14, 2015\n\u001c42\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe unanticipated problems and opportunities then essentially fight the deliberate strategy for the attention, capital, and hearts of the management and employees. The company has to decide whether to stick with the original plan, modify it, or even replace it altogether with one of the alternatives that arises. The decision sometimes is an explicit decision; often, however, a modified strategy coalesces from myriad day-to-day decisions to pursue unanticipated opportunities and resolve unanticipated problems. When strategy forms in this way, it is known as emergent strategy. The managers of Honda’s beachhead in Los Angeles, for example, did not make an explicit decision to completely change strategy, to focus on the low-cost Super Cubs, in an all-day strategy meeting. Rather, they slowly realized that if they stopped\n\nJanuary 14, 2015\n\u001c42\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cselling the big bikes, it would stem the cash-bleed needed to cover the cost of the leaky-oil repairs. And, one by one, as employees ordered more Super Cub bikes from Japan, the path for profitable growth became clear.\n\nJanuary 14, 2015\n\u001c43\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1IdkxUy-TFCsmXKV7saDI9oeScTeqk6N4xfdIMfA","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1GVTk7QnQLHnwXonQjNxhyW3bZxk2hT5KZ_76ylc","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1Oo2NgLXmlwtPA9l2V7IDzzS2QHP_AUZ5DAW4xoM","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0