alse,"ts_bgc_i":false}},{"ty":"as","st":"text","si":2804,"ei":2818,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":2819,"ei":2836,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":2837,"ei":2927,"sm":{"ts_ff_i":false,"ts_va":"nor","ts_it":true,"ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":2928,"ei":2945,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":2946,"ei":2963,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":2964,"ei":3793,"sm":{"ts_ff_i":false,"ts_va":"nor","ts_it":true,"ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":3794,"ei":3811,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":3812,"ei":3829,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}},{"ty":"as","st":"text","si":3830,"ei":4049,"sm":{"ts_ff_i":false,"ts_va":"nor","ts_it":true,"ts_va_i":false,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4050,"ei":4067,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4068,"ei":4073,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik"  nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik"  nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik">DOCS_modelChunk = [{"ty":"is","ibi":4074,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen the company’s leaders made a clear decision to pursue the new direction, the emergent strategy became the new deliberate strategy.\n\nJanuary 14, 2015\n\u001c43\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cstrategy is not a discrete analytical event—something decided, say, in a meeting of top managers based on the best numbers and analysis available at the time. Rather, it is a continuous, diverse, and unruly process\n\nJust like our lives\n\nJanuary 14, 2015\n\u001c43\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt may be challenging and unruly, but this is the process by which almost all companies have developed a winning strategy. Walmart is another great example. Many people think of Sam Walton, Walmart’s legendary founder, as a visionary. They assume he started his company with a plan to change the world of retailing. But that’s not what really happened. Walton originally intended to build his second store in Memphis, thinking that a larger city could support a larger store. But he ended up opting for the much smaller town of Bentonville, Arkansas, instead—for two reasons. Legend has it, his wife said in no uncertain terms that she would not move to Memphis.\n\nJanuary 14, 2015\n\u001c43\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe also recognized that having his second store near his first would allow him to share\n\nJanuary 14, 2015\n\u001c43\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cshipments and deliveries more easily, and take advantage of other logistical efficiencies. That, ultimately, taught Walton the brilliant strategy of opening his large stores only in small towns—thereby preempting competition from other discount retailers. This wasn’t how he imagined his business in the beginning. His strategy emerged\n\nJanuary 14, 2015\n\u001c44\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI’m always struck by how many of my students and the other young people I’ve worked with think they’re supposed to have their careers planned out, step by step, for the next five years. High-achievers, and aspiring high-achievers, too often put pressure on themselves to do exactly this. Starting as early as high school, they think that to be successful they need to have a concrete vision of\n\nJanuary 14, 2015\n\u001c44\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cexactly what it is they want to do with their lives. Underlying this belief is the implicit assumption that they should risk deviating from their vision only if things go horribly wrong. But having such a focused plan really only makes sense in certain circumstances. In our lives and in our careers, whether we are aware of it or not, we are constantly navigating a path by deciding between our deliberate strategies and the unanticipated alternatives that emerge. Each approach is vying for our minds and our hearts, making its best case to become our actual strategy. Neither is inherently better or worse; rather, which you should choose depends on where you are on the journey. Understanding this—that strategy is made up of these two disparate elements, and that your circumstances dictate which approach is best—will better enable you to sort through the choices that your career will\n\nJanuary 14, 2015\n\u001c44\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you have found an outlet in your career that provides both the requisite hygiene factors and motivators, then a deliberate approach makes sense. Your aspirations should be clear, and you know from your present experience that they are worth striving for. Rather than worrying about adjusting to unexpected opportunities, your frame of mind should be focused on how best to achieve the goals you have deliberately set. But if you haven’t reached the point of finding a career that does this for you, then, like a new company finding its way, you need to be emergent. This is another way of saying that if you are in these circumstances, experiment in life. As you learn from each experience, adjust. Then iterate quickly. Keep going through this process until your strategy begins to click. As you go through your career, you will begin to find the areas of work you love and in which you will shine; you\n\nJanuary 14, 2015\n\u001c44\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwill, hopefully, find a field where you can maximize the motivators and satisfy the hygiene factors. But it’s rarely a case of sitting in an ivory tower and thinking through the problem until the answer pops into your head. Strategy almost always emerges from a combination of deliberate and unanticipated opportunities. What’s important is to get out there and try stuff until you learn where your talents, interests, and priorities begin to pay off. When you find out what really works for you, then it’s time to flip from an emergent strategy to a deliberate one.\n\nJanuary 14, 2015\n\u001c45\n\u0011\n\u0011"},{"ty":"te","id":"i.10","spi":4083},{"ty":"te","id":"i.11","spi":4256},{"ty":"te","id":"i.12","spi":4529},{"ty":"te","id":"i.13","spi":5229},{"ty":"te","id":"i.14","spi":5354},{"ty":"te","id":"i.15","spi":5727},{"ty":"te","id":"i.16","spi":6158},{"ty":"te","id":"i.17","spi":7087},{"ty":"te","id":"i.18","spi":8031},{"ty":"as","st":"paragraph","si":4074,"ei":4074,"sm":{"ps_klt_i":true,"ps_sb_i":