mentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik"  nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik"  nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik">DOCS_modelChunk = [{"ty":"is","ibi":8626,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdiscovery-driven planning,” but it might be easier to think about it as “What has to prove true for this to work?” As simple as it sounds, companies seldom think about whether to pursue new opportunities by asking this question. Instead, they often unintentionally stack the deck for failure from the beginning. They make decisions to go ahead with an investment based on what initial projections suggest will happen, but then they never actually test whether those initial projections are accurate. So, they can find themselves far down the line, adjusting projections and assumptions to fit what is actually happening, rather than making and testing thoughtful choices before they get too far in.\n\nJanuary 14, 2015\n\u001c48\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhich of these assumptions need to prove true in order for us to realistically expect that these numbers will materialize?” The assumptions on this list should be rank-ordered by importance and uncertainty. At the top of the list should be the assumptions that are most important and least certain, while the bottom of the list should be those that are least important and most certain. Only after you understand the relative importance of all the underlying assumptions should you green-light the team—but not in the way that most companies tend to do. Instead, find ways to quickly, and with as little expense as possible, test the validity of the most important assumptions.\n\nJanuary 14, 2015\n\u001c51\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBefore you take a job, carefully list what things others are going to need to do or to deliver in order for you to\n\nJanuary 14, 2015\n\u001c52\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csuccessfully achieve what you hope to do. Ask yourself: “What are the assumptions that have to prove true in order for me to be able to succeed in this assignment?” List them. Are they within your control? Equally important, ask yourself what assumptions have to prove true for you to be happy in the choice you are contemplating. Are you basing your position on extrinsic or intrinsic motivators? Why do you think this is going to be something you enjoy doing? What evidence do you have? Every time you consider a career move, keep thinking about the most important assumptions that have to prove true, and how you can swiftly and inexpensively test if they are valid. Make sure you are being realistic about the path ahead of you.\n\nJanuary 14, 2015\n\u001c52\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001calthough it is hard to get it right at first, success doesn’t rely on this. Instead, it hinges on continuing to experiment until you do find an approach that works. Only a lucky few companies start off with the strategy that ultimately leads to success\n\nJanuary 14, 2015\n\u001c54\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnce you understand the concept of emergent and deliberate strategy, you’ll know that if you’ve yet to find something that really works in your career, expecting to have a clear vision of where your life will take you is just wasting time. Even worse, it may actually close your mind to unexpected opportunities\n\nJanuary 14, 2015\n\u001c54\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAs difficult as it may seem, you’ve got to be honest with yourself about this whole process. Change can often be difficult, and it will probably seem easier to just stick with what you are already doing. That thinking can be dangerous. You’re only kicking the can down the road, and you risk waking up one day, years later, looking into the mirror, asking yourself: “What am I doing with my life?”\n\nHow r we getting to know students. Thats a big assumption in my job - we need to be doing things with them to get our shit done.\n\nJanuary 14, 2015\n\u001c54\n\u0011\n\u0011\n\n\n4\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cReal strategy—in companies and in our lives—is created through hundreds of everyday decisions about where we spend our resources. As you’re living your life from day to day, how do you make sure you’re heading in the right direction? Watch where your resources flow. If they’re not supporting the strategy you’ve decided upon, then you’re not\n\nJanuary 14, 2015\n\u001c56\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cimplementing that strategy at all.\n\nJanuary 14, 2015\n\u001c56\n\u0011\n\u0011"},{"ty":"te","id":"i.19","spi":8635},{"ty":"te","id":"i.20","spi":9371},{"ty":"te","id":"i.21","spi":10086},{"ty":"te","id":"i.22","spi":10238},{"ty":"te","id":"i.23","spi":11008},{"ty":"te","id":"i.24","spi":11298},{"ty":"te","id":"i.25","spi":11647},{"ty":"te","id":"i.26","spi":12216},{"ty":"te","id":"i.27","spi":12596},{"ty":"as","st":"paragraph","si":8626,"ei":8626,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":8627,"ei":8627,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":8628,"ei":8628,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":8630,"ei":8630,"sm":{"cell_pb_i":false,"cell_pr_i":f