11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":12599,"ei":12634,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":12635,"ei":12652,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik"  nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik"  nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik">DOCS_modelChunk = [{"ty":"is","ibi":12659,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt SonoSite, for example, what made sense from the CEO’s perspective did not make sense from the salesman’s perspective. What made sense to engineers—pushing the frontier of performance in the next products beyond the best of their current products, mak ing them more sophisticated and capable, regardless of expense—was counter to the logic of the company’s strategy, which was to make the iLook even smaller and more affordable.\n\nJanuary 14, 2015\n\u001c58\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEverything related to strategy inside a company is only intent until it gets to the resource allocation stage. A company’s vision, plans, and opportunities—and all of its threats and problems—all want priority, vying against one another to become the actual strategy the company\n\nJanuary 14, 2015\n\u001c59\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut individuals are far from the only cause of this problem. In fact, if you study the root causes of business disasters, over and over you’ll find a predisposition toward endeavors that offer immediate gratification over endeavors that result in long-term success. Many companies’ decision-making systems are designed to steer investments to initiatives that offer the most tangible and immediate returns, so companies often favor these and shortchange investments in initiatives that are crucial to their long-term strategies.\n\nJanuary 14, 2015\n\u001c60\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn the words of Andy Grove: “To understand a company’s strategy, look at what they actually do rather than what they say they will do.” Resource allocation works pretty much the same way in our lives and careers. Gloria Steinem framed strategy for her world as Andy Grove did for his: “We can tell our values by looking at our checkbook stubs.” The dilemma of what machine to pull out of a salesperson’s bag is very similar to the dilemma we all face near the end of a workday: do I spend another half hour at work to get something extra done, or do I go home and play with my children?\n\nJanuary 14, 2015\n\u001c63\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthat we make in the strategy that becomes our lives: we have resources—which include personal time, energy, talent, and wealth—and we are using them to try to grow several “businesses” in our personal lives. These include having a rewarding relationship with our spouse or significant other; raising great children; succeeding in our careers; contributing to our church or community; and so on. Unfortunately, however, our resources are limited and these businesses are competing for them. It’s exactly the same problem that a corporation has. How should we devote our resources to each of these pursuits? Unless you manage it mindfully, your personal resource allocation process will decide investments for you according to the “default” criteria that essentially are wired into your brain and your heart\n\nJanuary 14, 2015\n\u001c63\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut it’s a messy process. People ask for your time and energy every day, and even if you are focused on what’s important to you, it’s still difficult to know which are the right choices. If you have an extra ounce of energy or a spare thirty minutes, there are a lot of people pushing you to spend them here rather than there. With so many people and projects wanting your time and attention, you can feel like you are not in charge of your own destiny. Sometimes that’s good: opportunities that you never anticipated emerge. But other times, those opportunities can take you far off course, as was true for so many of my classmates. The danger for high-achieving people is that they’ll unconsciously allocate their resources to activities that yield the most immediate, tangible accomplishments\n\nJanuary 14, 2015\n\u001c63\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis is often in their careers, as this domain of their life provides the most concrete evidence that they are moving forward. They ship a product, finish a design, help a patient, close a sale, teach a class, win a case, publish a paper, get paid, get promoted. They leave college and find it easy to direct their precious energy into building a career. The students in my class are often like this—they leave school with an intense drive to have something to show for their education. In fact, how you allocate your own resources can make your life turn out to be exactly as you hope or very different from what you intend. For those of my classmates who inadvertently invested in lives of hollow unhappiness, I can’t help but believe that their troubles stemmed from incorrectly allocating resources.\n\nI wanna understand students but I\u0027m not spending time with students.\n\nJanuary 15, 2015\n\u001c64\n\u0011\n\