ty":"as","st":"text","si":16285,"ei":16302,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":16321,"ei":17125,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":17126,"ei":17195,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#424242","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":17196,"ei":17213,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik"  nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik"  nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik">DOCS_modelChunk = [{"ty":"is","ibi":17220,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA strategy—whether in companies or in life—is created through hundreds of everyday decisions about how you spend your time, energy, and money. With every moment of your time, every de cision about how you spend your energy and your money, you are making a statement about what really matters to you. You can talk all you want about having a clear purpose and strategy for your life, but ultimately this means nothing if you are not investing the resources you have in a way that is consistent with your strategy. In the end, a strategy is nothing but good intentions unless it’s effectively implemented.\n\nJanuary 15, 2015\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHow do you make sure that you’re implementing the strategy you truly want to implement? Watch where your resources flow —the resource allocation process. If it is not supporting the strategy you’ve decided upon, you run the risk of a serious problem. You might think you are a charitable person, but how often do you really give your time or money to a cause or an organization that you care about? If your family matters most to you, when you think about all the choices you’ve made with your time in a week, does your family seem to come out on top? Because if the decisions you make about where you invest your blood, sweat, and tears are not consistent with the person you aspire to be, you’ll never become that person.\n\nJanuary 15, 2015\n\u001c66\n\u0011\n\u0011\n\n\nSection II\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJanuary 15, 2015\n\u001c69\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWork can bring you a sense of fulfillment—but it pales in comparison to the enduring happiness you can find in the intimate relationships that you cultivate with your family and close friends.\n\nJanuary 15, 2015\n\u001c71\n\u0011\n\u0011\n\n\n5\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe relationships you have with family and close friends are going to be the most important sources of happiness in your life. But you have to be careful. When it seems like everything at home is going well, you will be lulled into believing that you can put your investments in these relationships onto the back burner. That would be an enormous mistake. By the time serious problems arise in those relationships, it often is too late to repair them. This means, almost paradoxically, that the time when it is most important to invest in building strong families and close friendships is when it appears, at the surface, as if it’s not necessary.\n\nJanuary 15, 2015\n\u001c74\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhile most of us do have a deliberate strategy of creating deep, love-filled relationships with members of our family and our friends, in reality we invest in a strategy for our lives that we would never have aspired to: having shallow friendships with many but deep friendships with none;\n\nJanuary 15, 2015\n\u001c79\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEach of us can point to one or two friendships we’ve unintentionally neglected when life got busy. You might be hoping that the bonds of your friendship are strong enough to endure such neglect, but that’s seldom the case. Even the most committed friends will attempt to stay the course for only so long before they choose to invest their own time, energy, and friendship somewhere else. If they do, the loss will be yours. People in their later years in life so often lament that they didn’t keep in better touch with friends and relatives who once mattered profoundly to them. Life just seemed to get in the way. The consequences of letting that happen, however, can be enormous\n\nJanuary 15, 2015\n\u001c81\n\u0011\n\u0011\n\n\n6\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe same is true in our relationships: we go into them thinking about what we want rather than what is important to the other person. Changing your perspective is a powerful way to deepen your relationships.\n\nJanuary 18, 2015\n\u001c87\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIKEA’s entire business model—the shopping experience, the layout of the store, the design of the products and the way they are packaged—is very different from the standard furniture store\n\nJanuary 18, 2015\n\u001c87\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen a company understands the jobs that arise in people’s lives, and then develops products and the accompanying experiences required in purchasing and using the product to do the job perfectly, it causes customers to instinctively “pull” the product into their lives whenever the job arises. But when a company simply makes a product that other companies also can make—and is a product that can do lots of jobs but none of them well—it\n\nWhat\u0027s our students\u0027 job to be done? Looking for a way to broaden their horizons? Looking for a guide to ensure they get the most out of college?\n\nJanuary 18, 2015\n\u001c89\n\u0011\n\u0011"},{"ty":"te","id":"i.35","spi":17229},{"ty":"te","id":"i.36","spi":17870},{"ty":"te","id":"i.37","spi":18644},{"ty":"te","id":"i.38","spi":18680},{"ty":"te","id":"i.39","spi":18914},{"ty":"te","id":"i.40","spi":19599},{"ty":"te","id":"i.41","spi":19926},{"ty":"te","id":"i.42","spi":20648},{"ty":"te","id":"i.43","spi":20893},{"ty":"te","id":"i.44","spi":21118},{"ty":"as","st":"paragraph","si":17220,"ei":17220,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":17221,"ei":17221,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":17222,"ei":17222,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":17224,"ei":17224,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":17226,"ei":17226,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":17228,"ei":17228,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cel