ty":"as","st":"text","si":20860,"ei":20877,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":20896,"ei":21084,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":21085,"ei":21102,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":21121,"ei":21559,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":21560,"ei":21706,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#424242","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":21707,"ei":21724,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik"  nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik"  nonce="CvPyfrc6CiZbWmrP51fuP+rJ0Ik">DOCS_modelChunk = [{"ty":"is","ibi":21731,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEvery successful product or service, either explicitly or implicitly, was structured around a job to be done. Addressing a job is the causal mechanism behind a purchase.\n\nJanuary 18, 2015\n\u001c94\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe two fundamental jobs that children need to do are to feel successful and to have friends—every day. Sure, they could hire school to get these jobs done. Some achieve success and friends in the classroom, the band, the math club, or the basketball team. But to feel successful and have friends, they could also drop out of school and join a gang, or buy a car and cruise the streets. Viewed from the perspective of jobs, it becomes very clear that schools don’t often do these jobs well at all—in fact, all too often, schools are structured to help most students feel like failures. We had assumed going in that those who succeed at school do so because they are motivated. But we concluded that all students are similarly motivated—to succeed. The problem is, only a fraction of students feel successful through school.\n\nTetsuya - I should not just have a few friends - I should meet and get to know others. To find something I enjoy doing. I\u0027ll study for it. Also it would be nice...if it connected to a future job. Hire college to rest from k12 exam stress and to explore before job hunting and being told what to do. Join a club with committed alumni - a club that has a high bte, and maybe u get moved up the job hunt totem pole\n\nJanuary 18, 2015\n\u001c96\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere is no way that we can motivate children to work harder in class by convincing them that they should do this. Rather, we need to offer children experiences in school that help them do these jobs—to feel successful and do it with friends. Schools that have designed their curriculum so that students feel success every day see rates of dropping out and absenteeism fall to nearly zero. When structured to do the job of success, students eagerly master difficult material—because in doing so, they are getting the job done.\n\nJanuary 18, 2015\n\u001c96\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s natural to want the people you love to be happy. What can often be difficult is understanding what your role is in that. Thinking about your relationships from the perspective of the job to be done is the best way to understand what’s important to the people who mean the most to you. It allows you to develop true empathy. Asking yourself “What job does my spouse most need me to do?” gives you the ability to think about it in the right unit of analysis. When you approach your relationships from this perspective, the answers will become much more clear than they would by simply speculating about what might be the right thing to do. But you have to go beyond understanding what job your spouse needs you to do. You have to do that job.\n\nJanuary 18, 2015\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou’ll have to devote your time and energy to the effort, be willing to suppress your own priorities and desires, and focus on doing what is required to make the other person happy. Nor should we be timid in giving our children and our spouses the same opportunities to give of themselves to others. You might think this approach would actually cause resentment in relationships because one person is so clearly giving up something for the other. But I have found that it has the opposite effect. In sacrificing for something worthwhile, you deeply strengthen your commitment to it.\n\nJanuary 18, 2015\n\u001c102\n\u0011\n\u0011\n\n\n8\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAfter he retired, he discussed with my students how he’d managed his career. What he described was not all of the steps on his résumé, but rather why he took them. Though he didn’t use this language, he built his career by registering for specific courses in the schools of experience. Archibald had a clear goal in mind when he graduated from college—he wanted to become CEO of a successful company. But instead of set